import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [content,setContent] = useState("")

  useEffect(()=>{
    axios.get("www.baidu.com").then((res)=>{
      setContent(res.data)
    })
  })

  const sendRequest = ()=>{
    const API_KEY = 'your-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-key-here';
    const API_URL = 'https://api-inference.huggingface.co/models/EleutherAI/gpt-neo-1.3B';
    const headers = { 'Authorization': `Bearer ${API_KEY}` };
    const data = { 'inputs': 'hello' };


    axios.post(API_URL, data, { headers })
    .then(response => console.log(response.data) ,setContent(response.data))
    .catch(error => console.error(error));
  }

  return (
    <div className="App">
      <div>{content}</div>
    </div>
  );
}

export default App;
